import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Find and click the "Electronics" category link.
    // We use .first() because there are multiple links with this text.
    const electronicsLink = page.getByRole('link', { name: 'Electronics', exact: true }).first();
    await electronicsLink.waitFor({ state: 'visible', timeout: 5000 });
    await electronicsLink.click();

    // Take a screenshot after clicking the link
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_click.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_click.png'));

    // Verify navigation by checking for the category header
    const categoryHeader = page.locator('h2:has-text("Electronics")');
    await categoryHeader.waitFor({ state: 'visible', timeout: 5000 });
    const headerText = await categoryHeader.innerText();

    return {
      success: true,
      action: "Navigated to the Electronics category",
      extractedData: {
        categoryTitle: headerText
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to navigate to the Electronics category",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
